CREATE TABLE `country` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `display_order` int NOT NULL,
  `status` int NOT NULL,
  `a2` varchar(2) NOT NULL,
  `a3` varchar(255) NOT NULL,
  `numeric_code` int NOT NULL,
  `active` tinyint NOT NULL DEFAULT '1',
  `created` datetime NOT NULL,
  `created_by` varchar(255) NOT NULL,
  `modified` datetime DEFAULT NULL,
  `modified_by` varchar(255) DEFAULT '',
  PRIMARY KEY (`id`),
  KEY `idx_country_display_order` (`display_order`),
  KEY `idx_country_active` (`active`) ,
  KEY `displayorder_country` (`display_order`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;

CREATE TABLE `city` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `code` varchar(255) NOT NULL,
  `display_order` int NOT NULL DEFAULT '5000',
  `latitude` decimal(12,2) DEFAULT NULL,
  `longitude` decimal(12,2) DEFAULT NULL,
  `timezone` varchar(255) DEFAULT NULL,
  `country` int NOT NULL,
  `active` tinyint NOT NULL DEFAULT '1',
  `created` datetime NOT NULL,
  `created_by` varchar(255) NOT NULL,
  `modified` datetime DEFAULT NULL,
  `modified_by` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `code_UNIQUE` (`code`),
  KEY `idx_city__country` (`country`),
  KEY `cityName_city` (`name`),
  KEY `displayorder_city` (`display_order`),
  FULLTEXT KEY `cityNameFullTextSearch` (`name`),
  CONSTRAINT `fk_city__country` FOREIGN KEY (`country`) REFERENCES `country` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;


